/** @format */

import React from "react";
import { CardImageBlock, CardImageItem } from "./StyleStoreCard";
const CardImage = ({ images }) => {
  if (images.length < 3) {
    return (
      <CardImageBlock>
        <CardImageItem />
      </CardImageBlock>
    );
  } else {
    return (
      <CardImageBlock>
        <CardImageItem style={{ width: "30%", marginRight: "10px" }} />
        <CardImageItem style={{ width: "30%", marginRight: 3 }} />
        <CardImageItem style={{ width: "30%", marginRight: 3 }} />
      </CardImageBlock>
    );
  }
};

export default CardImage;
